import React from "react";
import { Link } from "react-router-dom";
import PropTypes from "prop-types";

const DashboardCard = ({
  profile: {
    status,
    company,
    location,
    user: { name, avatar },
    userImg,
  },
}) => {
  return (
    <div className="dashboard-card-component">
      <img
          className="round-img my-1 dashboard-card-img "
          src={userImg ? userImg : avatar}
          alt=""
      />
      <h1 className="dashboard-card-name">{name}</h1>   
      <p className="profile-top__status font2-bold">
          {status} {company && <span> at {company}</span>}
      </p>
      <p className="profile-top__location font2-bold">
         {location && <span>{location}</span>}
      </p>      
    </div>
  );
};

DashboardCard.propTypes = {
  profile: PropTypes.object.isRequired,
};

export default DashboardCard;
